import "bootstrap/dist/css/bootstrap.min.css";

import { createApp, VueElement } from "vue";
import App from "./App.vue";

new Vue({
  render: (h) => h(App),
}).$mount("#app");

// createApp(App).mount("#app");
import "bootstrap/dist/js/bootstrap.js";
